import React from 'react';

const KeyboardKeysComponent = () => {
  const containerStyle = {
    position: 'fixed',
    top: 0,
    left: 0,
    width: '100%',
    height: '100%',
    backgroundColor: 'black', // Change background color to black
    overflow: 'hidden',
    perspective: '1000px', // Perspective for 3D effect
  };

  const key1Style = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%) rotateY(0deg)',
    animation: 'moveKeys 2s ease forwards',
    fontSize: '10rem', // Adjust font size as needed
    color: 'white', // Change color to white
  };

  const key2Style = {
    position: 'absolute',
    top: '60%', // Adjust the top position for key B
    left: '50%', // Keep the left position centered
    transform: 'translate(-50%, -50%) rotateY(0deg)',
    animation: 'moveKeys 2s ease forwards',
    fontSize: '2rem', // Adjust font size as needed
    color: 'white', // Change color to white
  };

  return (
    <div style={containerStyle}>
      <div style={key1Style}>NISSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSSH</div>
      <div style={key2Style}>B</div>
      {/* Add more keys as needed */}
      <style>
        {`
        @keyframes moveKeys {
          0% {
            transform: translateZ(-1000px) rotateX(60deg); /* Initial position, moving away */
            opacity: 0;
          }
          100% {
            transform: translateZ(0) rotateX(0deg); /* Final position, moving towards the viewer */
            opacity: 1;
          }
        }
        `}
      </style>
    </div>
  );
};

export default KeyboardKeysComponent;
